u8 parity(u64 v) {
	int parity = 0;  // parity will be the parity of v
	while (v)
	{
		parity = !parity;
		v = v & (v - 1);
	}
	return parity;
}

int weight(u64 x) {
	int r = 0;
	while (x) {
		if (x & 0x1)
			r++;
		x >>= 1;
	}
	return r;
}

u64 sub_layer(u64 x) {
	u64 y = 0;
	for (int i = 0; i < 8; ++i)
		y ^= S_compact[i][(x >> (8*i)) & 0xFF];
	return y;
}

u64 inv_sub_layer(u64 x) {
	u64 y = 0;
	for (int i = 0; i < 8; ++i)
		y ^= S_inv_compact[i][(x >> (8*i)) & 0xFF];
	return y;
}

u64 perm_layer(u64 x) {
	u64 y = 0;
	for (int i = 0; i < 8; ++i)
		y ^= P_compact[i][(x >> (8*i)) & 0xFF];
	return y;
}

u64 inv_perm_layer(u64 x) {
	u64 y = 0;
	for (int i = 0; i < 8; ++i)
		y ^= P_inv_compact[i][(x >> (8*i)) & 0xFF];
	return y;
}

void dirty_rc_bits(u64 &l, u64 &r) {
	if (l & 0x7)
		l |= 0x7ull;
	if (r >> 62)
		r |= (0x3ull << 62);
}

void dirty_sbox_bits(u64 &x) {
	if (x >> 60)
		x |= (0xFull << 60);
	if (x >> 56)
		x |= (0xFull << 56);
}

// 128-bit key schedule
void rotate_keys_128(u64 &l, u64 &r) {
	u64 t0 = l;
	l = ((l & 0x7) << 61) ^ (r >> 3);
	r = ((r & 0x7) << 61) ^ (t0 >> 3);
}
void inv_rotate_keys_128(u64 &l, u64 &r) {
	u64 t0 = l;
	l = (l >> 61) ^ ((r & 0x1FFFFFFFFFFFFFFFull) << 3);
	r = (r >> 61) ^ ((t0 & 0x1FFFFFFFFFFFFFFFull) << 3);
}
void inv_keysched_round_128(u64 &left, u64 &right, u64 rc) {
	left ^= (rc >> 2);
	right ^= (rc << 62);
	left = (S_inv[(left >> 60) & 0xF] << 60) ^ (S_inv[(left >> 56) & 0xF] << 56) ^ (left & 0x00FFFFFFFFFFFFFFull);
	inv_rotate_keys(left, right);
}
void keysched_round_128(u64 &left, u64 &right, u64 rc) {
	rotate_keys(left, right);
	left = (S[(left >> 60) & 0xF] << 60) ^ (S[(left >> 56) & 0xF] << 56) ^ (left & 0x00FFFFFFFFFFFFFFull);
	left ^= (rc >> 2);
	right ^= (rc << 62);
}

// 80-bit key schedule
void rotate_keys_80(u64 &l, u64 &r) {
	u64 t0 = l;
	l <<= 61;
	l ^= (r << 45);
	l ^= (t0 >> 19);
	r = ((t0 >> 3) & 0xFFFFull);
}
void inv_rotate_keys_80(u64 &l, u64 &r) {
	u64 t0 = l;
	l >>= 61;
	l ^= (r << 3);
	l ^= (t0 << 19);
	r = ((t0 >> 45) & 0xFFFFull);
}
void keysched_round_80(u64 &left, u64 &right, u64 rc) {
	rotate_keys_80(left, right);
	left = (S[(left >> 60) & 0xF] << 60) ^ (left & 0x0FFFFFFFFFFFFFFFull);
	left ^= (rc >> 1);
	right ^= ((rc & 0x1) << 15);
}
void inv_keysched_round_80(u64 &left, u64 &right, u64 rc) {
	left ^= (rc >> 1);
	right ^= ((rc & 0x1) << 15);
	left = (S_inv[(left >> 60) & 0xF] << 60) ^ (left & 0x0FFFFFFFFFFFFFFFull);
	inv_rotate_keys_80(left, right);
}

// WRAPPERS
void rotate_keys(u64 &l, u64 &r) {
	#if PRESENT80
		return rotate_keys_80(l, r);
	#else
		return rotate_keys_128(l, r);
	#endif
}
void inv_rotate_keys(u64 &l, u64 &r) {
	#if PRESENT80
		return inv_rotate_keys_80(l, r);
	#else
		return inv_rotate_keys_128(l, r);
	#endif
}
void keysched_round(u64 &left, u64 &right, u64 rc) {
	#if PRESENT80
		return keysched_round_80(left, right, rc);
	#else
		return keysched_round_128(left, right, rc);
	#endif
}
void inv_keysched_round(u64 &left, u64 &right, u64 rc) {
	#if PRESENT80
		return inv_keysched_round_80(left, right, rc);
	#else
		return inv_keysched_round_128(left, right, rc);
	#endif
}

void encrypt_one_round(u64 &state, u64 rk) {
	state ^= rk;
	state = sub_layer(state);
	state = perm_layer(state);
}

void decrypt_one_round(u64 &state, u64 rk) {
	state = inv_perm_layer(state);
	state = inv_sub_layer(state);
	state ^= rk;
}